import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import RouterForm from './pages/RouterForm';
import ReportName from './pages/ReportName';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<RouterForm />} />
          <Route path="/report-name" element={<ReportName />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
